import React from 'react'
import {Ptw} from '../context/PtwContext';

export default function Popup(props) {
  let theUsedContext = React.useContext(Ptw);


  let {data, ptwId} = theUsedContext.ptwState;

  console.log(data , ptwid)

  let popupValue = <h3>{`this ptw owned by ${theUsedContext.ptwState.ptw[theUsedContext.ptwState.ptwId].authorized}`}</h3>

  return (
    <>
      {
        theUsedContext.ptwState.popupShow && popupValue
      }
    </>
  )
}
